import React, { useState, useEffect } from 'react';

function FetchData() {
    const [data, setData] = useState('');

    useEffect(() => {
        fetchData();
    }, []);

    const fetchData = async () => {
        try {
            const response = await fetch('http://localhost:3001/data'); // Replace with your server URL
            const jsonData = await response.json();
            setData(jsonData.data);
        } catch (error) {
            console.error('Error fetching data:', error);
        }
    };

    const handleFetchClick = () => {
        fetchData();
    };

    return (
        <div>
            <h1>Data from API:</h1>
            <p>{data}</p>
            <button onClick={handleFetchClick}>Fetch Data</button> {/* Button to fetch data */}
        </div>
    );
}

export default FetchData;
